module.exports={heading:{en:"Tips on Recording Your Item",sm:"Pu'eina o se Item"},summary:{en:"For tips on how to record your item, click on the cards below.",sm:"Mo fautuaga i le auala e pu'eina ai lau item, kiliki i ata o loo mulimuli mai."},cards:[{previewHeading:{en:"Camera Angle",sm:"Le auala e faatulaga ai le mea pue ata"},heading:{en:"Find the Right Angle",sm:"Le auala e faatulaga ai le mea pue ata (video)"},text:{en:'<p>When recording your item, its best to first get your camera ready and set it in a position where we can see all of the participants in your videos nice faces. When setting up your camera, its good to make sure that your camera is steady and still. If your camera moves around too much, it can affect your videos quality of sound and picture.</p><p>A tip to help get the best angle for your video is by recording horizontally so that your camera has a more widened view.</p><img src="https://static.wixstatic.com/media/1b52b2_a94cb27ac0404b60a2117dbfc0b48d60~mv2.jpg" style="width: 100%; height: auto;" alt="Record horizontally not vertically.">',sm:"<p>A o pueina lou item, ia faamautinoa ua ofi uma tagata i totonu o le vitio. Taumafai e aua le minoi solo, ia tumau i se mea se tasi ona o le minoi solo e l lelei ai le ata ma le leo o lau faafiafiaga matagofie o loo pueina.</p><p>E lelei foi le pue faataatia/faalautele o le camera (horizontal) nai lo le faasao i luga (vertical) e mafai ona maua uma ai. </p>"},image:{slug:"camera"}},{previewHeading:{en:"Good Sound Quality",sm:"Lelei o le leo"},heading:{en:"Find A Position That Works Best to Capture Good Sound",sm:"Saili se nofoaga e talafeagai e puea lelei le leo o lau item"},text:{en:"<p>Depending on your item, it benefits to position your camera based on what you are presenting. For example, if your item is singing a song, make sure that your camera is positioned at a distance where we can hear your wonderful voice(s)! If you are deciding to play a separate supporting instrumental while you sing your song, try to find the proper balance of volume between the music and your voice so that neither sound gets overshadowed by the other.</p> <p>These tips also apply for those who may be playing an instrument while they sing, and for those preparing other types of items as well! Furthermore, no matter what your item may be, if you are talking/singing in your video, it helps when you try your best to project your voice so that we as the audience dont miss a single part of your lovely item. :-)</p>",sm:"<p>E fua i le tulaga o lau item lea o le a fai. Mo se faataitaiga afai o se pese o se mea lelei le faatulaga o lau camera i se mamao e mafai ona manino ai lou siufofoga matagofie. Afai o e fuafua e ta se mea faifaili e pei o se kitara, ukulele, po o se piano faatasi ma lou pese taumafai e faapaleni le leotele o le meafaifaili ma lou siufofoga ina ia aua nei maualuga nau le mea faifaili i lou leo po o lou leo foi i le mea faifaili. O nei manatu e mafai foi ona faaaog i so o se vala lava pe pese po o le talanoa foi ina ia aua nei misia le aofia se iota o lau faafiafiaga matagofie. :-)</p>"},image:{slug:"sound"}},{previewHeading:{en:"The Atmosphere",sm:"Siomaga"},heading:{en:"Creating Your Perfect Atmosphere",sm:"Le siomaga"},text:{en:"<p>When recording your item, make sure you are in a well-lit room where we can see your smiley face(s)! A tip that helps to create better lighting is recording with your flash on (if your camera has one), and/or setting up a light behind or next to your camera as you record. If you are recording during the day, another thing that helps is by opening up your blinds to create a more natural set of lighting when preparing your item.</p><p>Another way to create the perfect atmosphere is by limiting potential distractions if possible in your video. One tip to help regarding this topic is to examine your background for your item and making sure that there are no probable disturbances. This tip also applies to dressing for success and eliminating any unwanted noise that can be included in your video. In doing so, it is much appreciated and will help those in the audience to be able to get the full enjoyment in your wonderfully prepared item!</p>",sm:"<p>Pe a pueina lau item, ia faamautinoa o loo i se siomaga e malamalama lelei ina ia iloa lelei au foliga matagofie ma aulelei! O se manatu atonu e fesoasoani i te oe o le faaaog o le flash o lau camera pe afai e iai po o le faatulaga o se ml i tua po o tafatafa o lau camera a o pueina lau item. Afai o loo e pueina lau item i le ao e mafai ona tatala ie faamalama e faasau i totonu le malamalama. </p>"},image:{slug:"atmosphere"}},{previewHeading:{en:"Having Fun!",sm:"Fai ma le fiafia!"},heading:{en:"Having Fun!",sm:"Fai ma le fiafia!"},text:{en:"<p>It is important to understand that your wonderful efforts in preparing an item are very well treasured and there is no need to strive for perfection (As theres no such thing)! Giving your best through your expression of creativity and genuineness is the biggest part that is needed to create your special item.</p><p>We hope that these tips will help you to know where to start to record your item and that as you prepare you have loads of fun and happy times! If you have any additional questions regarding preparing your item or anything else, please feel free to contact any of the committee members for help.</p><p>Thank You!</p>",sm:"<p>E tua le iloaina o au sauniuniga matagofie o le a talisapaia ma le faapelepele, e leai la se manaoga mo se lelei atoatoa (Ona e leai se mea faapena)! O le mea tua o au taumafaiga filig ma le lotoatoa na tapena ai lau faafiafiaga faapitoa.</p><p>O lo matou faanaunauga ia fesoasoani nai nei taiala pupuu i le pueina o lau item ma a o faia au tapenaga e te maua ai le tele o le ollioil! A iai se fesili pe manaomia se fesoasoani faafesootai mai i matou.</p><p>Faafetai lava!</p>"},image:{slug:"fun"}}]};
